import Header from "../components/Header";
import HeroSection from "../components/HeroSection";

const Home = () => {
  return (
    <div>
      <Header />
      <HeroSection />
      <h1>
        Features/Services Section (List of key features or services provided,
        Icons or images representing each feature, Short descriptions)
      </h1>
      <h1>
        Testimonials/Reviews Section (Customer feedback or reviews, Star ratings
        (if applicable), Photos of customers (optional))
      </h1>
      <h1>
        Call-to-Action (CTA) Section ( A final push for users to take action
        (Sign up, Buy now, Contact us, etc.), Highlighted button )
      </h1>
      <h1>
        Footer ( Links to important pages (Privacy Policy, Terms of Service,
        etc.), Copyright notice, Social media links, Contact information )
      </h1>
    </div>
  );
};

export default Home;
